import React from "react";

const Bauble = ({ referenceLink = "#", ionicon }) => {
  return (
    <div>
      <a href={referenceLink} target="_blank" rel="noopener noreferrer">
        <ion-icon name={ionicon}></ion-icon>
      </a>
    </div>
  );
};

export default Bauble;
